import React, { Component } from 'react';

//component
import TodoList from './component/TodoList';

//css
import './App.css'
class App extends Component {
  constructor() {
    super();
    this.todolist = [
      "thuan di choi",
      "thuan o nha",
      "thuan di hoc"
    ]
  }
  render() {
    return (
      <div className="todoapp">
        {
          this.todolist.map((item, index) =>
            <TodoList
              key={index}
              title={item}
            />)
        }

      </div>
    );
  }
}

export default App;
